#include <iostream>
#include <string>
#include <algorithm>
using namespace std;
int main(){
    int n,ans=0;
    cin>>n;
    for(int i=2;i<=n;++i){
        for(int j=2;j<=n;++j){
            if(i==j){
                ++ans;
            }
            else if(i%j==0){
                break;
            }
        }
    }
    cout<<ans<<endl;
}
